import React from 'react';
import image from '../../images/Title.png';
const Macbook = () => {
  return (
    <div className="macbook">
      <div className="vertical">
      <p class="vertical-line">All Features</p>
      </div>
      <div className="macbook-box">
<div className="macbook-box-1">
    <p>What you get</p>
    <img src={image} alt="" />
</div>
      </div>
    </div>
  );
}

export default Macbook;
